void init()
{
	cou=0;

	vis[0]=1;
	for(int i=1;(i<<2)<=1000005;++i)
		if(vis[i]==0)
		{
			num[cou++]=i;

			for(int j=(i<<2)+i+1;(j<<2)<=1000005;j+=(i<<2)+1)
				vis[j]=1;
		}
}

int judge(int x)
{
	for(int i=0;i<cou && num[i]<=x;++i)
		if((x-num[i])%(4*num[i]+1)==0)
			if(vis[(x-num[i])/(4*num[i]+1)]==0)
				return 1;

	return 0;
}

